import {connect} from "react-redux";
import SearchComponent from './component';

const mapStateToProps = (state) => {
    return {
        age: state.age
    };
}

const mapDispatchToProps = (dispatch) => {
    return {
        onAgeUp: () => dispatch({type: "AGE_UP", value: 1}),
    };
}

export default connect(
    mapStateToProps,
    mapDispatchToProps
)(SearchComponent);
